import http from "./http-common";

class AuthService {
  login = async (email, password) => {
    return http.post("/login", {
      username: email,
      password: password,
    });
  };

  register = async (
    nombre,
    apellido,
    email,
    fechaNac,
    sexo,
    password,
    esProfesional
  ) => {
    return http.post("/registro", {
      nombre: nombre,
      apellido: apellido,
      email: email,
      fecha_nacimiento: fechaNac,
      sexo: sexo,
      password: password,
      esProfesional: esProfesional,
    });
  };
}

export default new AuthService();
